import React from 'react';
import logo from './logo.svg';
import './App.css';
import 'bootstrap/dist/css/bootstrap.min.css';
import { Button } from 'react-bootstrap';

function App() {
  return (
    <div className="App">
      <header className="App-header">
      <Button variant="primary" size="lg" active>
          Primary button
      </Button>
      </header>
    </div>
  );
}

export default App;
